import React, { useState, useEffect, useRef } from 'react';
import { 
  FiVideo, 
  FiVideoOff, 
  FiCamera, 
  FiSettings, 
  FiMaximize, 
  FiMinimize,
  FiRefreshCw,
  FiActivity,
  FiUsers,
  FiEye,
  FiAlertCircle
} from 'react-icons/fi';

const API_URL = 'http://localhost:5000';

const LiveFeed = () => {
  const [isFullscreen, setIsFullscreen] = useState(false);
  const [isPlaying, setIsPlaying] = useState(true);
  const [connectionStatus, setConnectionStatus] = useState('connected');
  const [recognitionStats, setRecognitionStats] = useState({
    totalDetected: 0,
    knownFaces: 0,
    unknownFaces: 0,
    lastUpdate: new Date()
  });
  const [faces, setFaces] = useState([]);
  const intervalRef = useRef();

  useEffect(() => {
    // Simulate real-time stats updates
    const interval = setInterval(() => {
      setRecognitionStats(prev => ({
        ...prev,
        totalDetected: prev.totalDetected + Math.floor(Math.random() * 3),
        knownFaces: prev.knownFaces + Math.floor(Math.random() * 2),
        unknownFaces: prev.unknownFaces + Math.floor(Math.random() * 1),
        lastUpdate: new Date()
      }));
    }, 5000);

    // Poll for face details every 1s
    intervalRef.current = setInterval(async () => {
      try {
        const res = await fetch(`${API_URL}/api/recognized_faces`);
        if (res.ok) {
          const data = await res.json();
          setFaces(data);
        }
      } catch (e) {
        setFaces([]);
      }
    }, 1000);

    return () => {
      clearInterval(interval);
      clearInterval(intervalRef.current);
    };
  }, []);

  const toggleFullscreen = () => {
    const videoContainer = document.getElementById('video-container');
    if (!isFullscreen) {
      if (videoContainer.requestFullscreen) {
        videoContainer.requestFullscreen();
      }
    } else {
      if (document.exitFullscreen) {
        document.exitFullscreen();
      }
    }
    setIsFullscreen(!isFullscreen);
  };

  const togglePlayPause = () => {
    setIsPlaying(!isPlaying);
  };

  const refreshFeed = () => {
    // Force refresh the video feed
    const videoElement = document.getElementById('video-feed');
    if (videoElement) {
      videoElement.src = `${API_URL}/video_feed?t=${Date.now()}`;
    }
  };

  const getStatusColor = () => {
    switch (connectionStatus) {
      case 'connected': return 'text-green-500';
      case 'connecting': return 'text-yellow-500';
      case 'disconnected': return 'text-red-500';
      default: return 'text-gray-500';
    }
  };

  const getStatusIcon = () => {
    switch (connectionStatus) {
      case 'connected': return <div className="status-online"></div>;
      case 'connecting': return <div className="w-3 h-3 bg-yellow-500 rounded-full animate-pulse"></div>;
      case 'disconnected': return <div className="status-offline"></div>;
      default: return <div className="w-3 h-3 bg-gray-500 rounded-full"></div>;
    }
  };

  return (
    <div className="space-y-6 fade-in">
      {/* Header */}
      <div className="glass-card p-6">
        <div className="flex flex-col md:flex-row md:items-center md:justify-between gap-4">
          <div className="flex items-center space-x-3">
            <div className="p-3 rounded-xl bg-gradient-to-r from-orange-500 to-red-500 text-white">
              <FiVideo size={24} />
            </div>
    <div>
              <h1 className="text-3xl font-bold gradient-text">Live Camera Feed</h1>
              <p className="text-gray-600 dark:text-gray-300">Real-time face recognition monitoring</p>
            </div>
          </div>
          <div className="flex items-center space-x-3">
            <div className="flex items-center space-x-2">
              {getStatusIcon()}
              <span className={`text-sm font-semibold ${getStatusColor()}`}>
                {connectionStatus.charAt(0).toUpperCase() + connectionStatus.slice(1)}
              </span>
            </div>
            <button 
              onClick={refreshFeed}
              className="btn-secondary"
            >
              <FiRefreshCw className="mr-2" />
              Refresh
            </button>
          </div>
        </div>
      </div>

      {/* Stats Cards */}
      <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
        <div className="gradient-card p-4 text-center">
          <div className="text-2xl font-bold text-gray-800 dark:text-white">{recognitionStats.totalDetected}</div>
          <div className="text-gray-600 dark:text-gray-300">Total Detected</div>
        </div>
        <div className="gradient-card p-4 text-center">
          <div className="text-2xl font-bold text-gray-800 dark:text-white">{recognitionStats.knownFaces}</div>
          <div className="text-gray-600 dark:text-gray-300">Known Faces</div>
        </div>
        <div className="gradient-card p-4 text-center">
          <div className="text-2xl font-bold text-gray-800 dark:text-white">{recognitionStats.unknownFaces}</div>
          <div className="text-gray-600 dark:text-gray-300">Unknown Faces</div>
        </div>
        <div className="gradient-card p-4 text-center">
          <div className="text-2xl font-bold text-gray-800 dark:text-white">
            {recognitionStats.totalDetected > 0 
              ? Math.round((recognitionStats.knownFaces / recognitionStats.totalDetected) * 100) 
              : 0}%
          </div>
          <div className="text-gray-600 dark:text-gray-300">Recognition Rate</div>
        </div>
      </div>

      {/* Video Feed */}
      <div 
        id="video-container"
        className={`glass-card overflow-hidden ${isFullscreen ? 'fixed inset-0 z-50' : ''}`}
      >
        {/* Video Header */}
        <div className="flex items-center justify-between p-4 border-b border-gray-200 dark:border-gray-700">
          <div className="flex items-center space-x-3">
            <FiCamera className="text-gray-600 dark:text-gray-400" />
            <h3 className="text-lg font-semibold text-gray-800 dark:text-white">Primary Camera</h3>
          <div className="flex items-center space-x-2">
            <span className="relative flex h-3 w-3">
              <span className="animate-ping absolute inline-flex h-full w-full rounded-full bg-red-400 opacity-75"></span>
              <span className="relative inline-flex rounded-full h-3 w-3 bg-red-500"></span>
            </span>
            <span className="text-sm font-medium text-red-500">LIVE</span>
          </div>
        </div>
        
          <div className="flex items-center space-x-2">
            <button
              onClick={togglePlayPause}
              className="p-2 rounded-lg bg-gray-100 dark:bg-gray-700 text-gray-600 dark:text-gray-300 hover:bg-gray-200 dark:hover:bg-gray-600 transition-colors duration-200"
            >
              {isPlaying ? <FiVideoOff size={16} /> : <FiVideo size={16} />}
            </button>
            <button
              onClick={toggleFullscreen}
              className="p-2 rounded-lg bg-gray-100 dark:bg-gray-700 text-gray-600 dark:text-gray-300 hover:bg-gray-200 dark:hover:bg-gray-600 transition-colors duration-200"
            >
              {isFullscreen ? <FiMinimize size={16} /> : <FiMaximize size={16} />}
            </button>
            <button className="p-2 rounded-lg bg-gray-100 dark:bg-gray-700 text-gray-600 dark:text-gray-300 hover:bg-gray-200 dark:hover:bg-gray-600 transition-colors duration-200">
              <FiSettings size={16} />
            </button>
          </div>
        </div>
        
        {/* Video Container */}
        <div className="relative bg-black">
          {isPlaying ? (
            <img
              id="video-feed"
              src={`${API_URL}/video_feed`}
              alt="Live camera feed"
              className="w-full h-auto max-h-[70vh] object-contain"
              onError={() => setConnectionStatus('disconnected')}
              onLoad={() => setConnectionStatus('connected')}
            />
          ) : (
            <div className="w-full h-96 bg-gray-900 flex items-center justify-center">
              <div className="text-center text-gray-400">
                <FiVideoOff className="mx-auto text-6xl mb-4" />
                <p className="text-lg">Feed Paused</p>
                <p className="text-sm">Click play to resume</p>
              </div>
            </div>
          )}
          
          {/* Overlay Info */}
          <div className="absolute top-4 left-4 bg-black/50 text-white px-3 py-1 rounded-lg text-sm">
            <div className="flex items-center space-x-2">
              <FiActivity className="text-green-400" />
              <span>Face Recognition Active</span>
            </div>
          </div>
          
          {/* Recognition Info */}
          <div className="absolute bottom-4 left-4 right-4 bg-black/50 text-white p-3 rounded-lg">
            <div className="grid grid-cols-3 gap-4 text-center">
              <div>
                <div className="flex items-center justify-center space-x-1">
                  <FiUsers className="text-blue-400" />
                  <span className="font-semibold">{recognitionStats.knownFaces}</span>
                </div>
                <span className="text-xs">Known</span>
              </div>
              <div>
                <div className="flex items-center justify-center space-x-1">
                  <FiEye className="text-red-400" />
                  <span className="font-semibold">{recognitionStats.unknownFaces}</span>
                </div>
                <span className="text-xs">Unknown</span>
              </div>
              <div>
                <div className="flex items-center justify-center space-x-1">
                  <FiActivity className="text-green-400" />
                  <span className="font-semibold">{recognitionStats.totalDetected}</span>
                </div>
                <span className="text-xs">Total</span>
              </div>
            </div>
          </div>
        </div>
      </div>
      
      {/* Info Section */}
      <div className="glass-card p-6">
        <h2 className="text-xl font-bold mb-4">Detected Faces in Frame</h2>
        {faces.length === 0 ? (
          <div className="text-gray-400">No faces detected.</div>
        ) : (
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
            {faces.map((face, idx) => (
              <div key={idx} className="p-4 rounded-xl bg-gray-100 dark:bg-gray-800 shadow">
                <div className="font-semibold text-lg mb-1">{face.name}</div>
                <div className="text-sm text-gray-600 dark:text-gray-300 mb-1">
                  <span className="font-mono">{face.status || face.type}</span>
                </div>
                {face.extra && (
                  <div className="text-xs text-gray-500">
                    {face.extra.age && <div>Age/Role: {face.extra.age || face.extra.role}</div>}
                    {face.extra.department && <div>Department: {face.extra.department}</div>}
                  </div>
                )}
                {face.score !== undefined && (
                  <div className="text-xs text-blue-500 mt-1">Confidence: {face.score}</div>
                )}
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default LiveFeed;
